sys_variable_value.value:
(function execute(inputs, outputs) {

  var arrayUtil = new global.ArrayUtil();
  var locations = gs.getProperty('x_cslb_vmox_integr.supported_locations').split(';');

  outputs.supported = arrayUtil.contains(locations, inputs.country);
})(inputs, outputs);

